    false,nt"url": null,nt"notes": "This annual narrative report for Union
    Slough National Wildlife Refuge and Iowa Wetland Management District summarizes
    Refuge activities during the 1999 fiscal year.  The report begins with an introduction
    to the Refuge and a summary of the yearu2019s highlights and climatic conditions.
     Information about monitoring and studies- including surveys and censuses- is provided
    next.  Habitat restoration and management projects are also covered; activities
    include water level management, moist soil management, mowing, farming, prescribed
    burning, and vegetation control.  Fish and wildlife management is discussed next
    with emphasis on bird banding, disease monitoring, reintroductions, and nest structures.
     Coordination activities, such as interagency coordination and private land activities,
    are outlined.  The resource protection section provides information about law enforcement,
    permits, contaminant cleanup, cultural resource management, and land acquisition.
     Information about public education and recreation is given.  Finally, Refuge planning
    and administration- including the Comprehensive Conservation Planning and general
    administration- are discussed.",nt"license_title": "License Not Specified",nt"extras":
